import React from "react";
import "./App.css";
import { LandingPage } from "./components";

function App() {
  return (
    <div>
      {/* <LandingPage /> */}
      <div
        style={{
          width: "100%",
          backgroundColor: "red",
          height: "25vh",
          overflowX: "hidden",
        }}
      ></div>
      <div
        style={{
          width: "100%",
          backgroundColor: "green",
          height: "45vh",
          overflowX: "hidden",
        }}
      ></div>
      <div
        style={{
          width: "100%",
          backgroundColor: "pink",
          height: "45vh",
          overflowX: "hidden",
        }}
      ></div>
    </div>
  );
}

export default App;
